text:
{'text': 'YC Dining and Bar is such a great spot! The place has a nice vibe—cozy, stylish, and perfect for a chill night out. The music isn’t too loud, and the lighting makes the whole space feel warm and welcoming.

The food was delicious and well-presented. Service was friendly and helpful—they made us feel really comfortable.

Definitely recommend this place for good food, great drinks, and a cool atmosphere.', 'languageCode': 'en'}

